    public static Response<String> sendPost(String url, Map<String, String> head,Map<String, String> params, String charset) {
        Response res = new Response();
        StringBuilder result = new StringBuilder();
        BufferedReader in = null;

        try {
            URL e2 = new URL(url);
            HttpURLConnection connection = (HttpURLConnection)e2.openConnection();
            connection.setRequestMethod("POST");
            for(Map.Entry<String,String> entry:head.entrySet()){
                connection.setRequestProperty(entry.getKey(), entry.getValue());
            }

            connection.setConnectTimeout(10000);
            connection.setReadTimeout(15000);
            connection.setDoOutput(true);
            connection.connect();
            String param = null;
            if(params != null && params.size() > 0) {
                StringBuilder code = new StringBuilder();
                Iterator line = params.entrySet().iterator();

                while(line.hasNext()) {
                    Map.Entry entry = (Map.Entry)line.next();
                    code.append((String)entry.getKey()).append("=").append(URLEncoder.encode((String) entry.getValue(), charset)).append("&");
                }

                param = code.substring(0, code.length() - 1);
                byte[] line1 = param.toString().getBytes();
                connection.getOutputStream().write(line1);
            }

            int code1 = connection.getResponseCode();
            System.out.println(code1);
            if(code1 == 200) {
                in = new BufferedReader(new InputStreamReader(connection.getInputStream(), charset));

                String line2;
                while((line2 = in.readLine()) != null) {
                    result.append(line2);
                }

                res.setCode("0000");
                res.setMsg("ok");
                res.setT(result.toString());
            } else {
                res.setCode("1001");
                res.setMsg("返回码异常:" + code1);
            }
        } catch (SocketTimeoutException var22) {
            res.setCode("1001");
            res.setMsg("连接超时");
            var22.printStackTrace();
        } catch (Exception var23) {
            res.setCode("1001");
            res.setMsg("连接异常");
            var23.printStackTrace();
        } finally {
            try {
                if(in != null) {
                    in.close();
                }
            } catch (Exception var21) {
                res.setCode("1002");
                res.setMsg("关闭连接异常");
                var21.printStackTrace();
            }

        }

        return res;
    }




